import Link from "next/link";

const News = () => {
    return (
        <div>
            <Link href="/"><a>Home</a></Link>
            <h1>NEWS</h1>
        </div>
    )
};

const mapStateToProps = state => {
  counter: state.counter.value
};

export default News;
